    "fullText": "cuore manzano: 4-1 all‚Äôaquila e primo posto nel girone i seggiolai si guadagnano i quarti in casa. in campo l‚Äô1 novembre contro una tra aquileia, pasiano e clark. copertina per iurlaro con doppietta ed eurogol manzano: calligaro, polidori, stacco, zharri erjon, genna, de giorgio leonardo, fusco, iurlaro, tancos, pozzatello, valentinuzzi, pascale. all: movio-sironi aquila reale: agrizzi, joao pedro, dindo, haxhiu, vitor hugo, bassetti, dorbol√≤ mattia, zanutini, mema, uruci, besic. all: genna. gol: 16‚Äô pt fusco, 17‚Äô st iurlaro, 18‚Äô pt zanutini, 20‚Äô st iurlaro, 8‚Äô st stacco. il manzano batte l‚Äôaquila reale al termine di una partita giocata ad alti livelli e chiude il girone al primo posto. nel primo tempo gli orange sono attenti in difesa e aiutati da un ottimo pozzatello resistono agli assalti dell‚Äôaquila. poco prima della sirena l‚Äôuno due targato fusco-iurlaro porta i locali sul 2-0. zanutini accorcia subito ma ancora iurlaro manda i suoi al riposo sul 3-1. nella ripresa il poker di stacco corona una prova di grande applicazione e intelligenza in tutte le fasi. il manzano conquista i quarti di finale in casa e resta in attesa di conoscere l‚Äôavversaria. primo tempo ‚Äì partita vivace, prima occasione per l‚Äôex zanutini che scheggia il palo esterno sullo scarico di dorbol√≤. il manzano risponde subito e agrizzi piazza due miracoli, prima una parata bassa su iurlaro, poi un riflesso sul tocco ravvicinato di fusco, ben smarcato da genna. sull‚Äôaltro fronte pozzatello non √® da meno: un grande intervento su zanutini ravvicinato, poi due riflessi su dindo che colpisce di tacco in area e poi ci prova da fuori: il portiere ex palmanova la mette sulla traversa. nel mezzo un palo di bassetti e un‚Äôoccasione sciupata da zanutini, che calcia alto a tu per tu. l‚Äôaquila ha qualit√† e si fa sentire nei duelli individuali, il manzano esce dal fortino a 4‚Äô dalla fine quando leonardo de giorgio si invola in solitaria verso agrizzi, scodellandogli un cucchiaio tra le mani. √® il preludio del gol: ripartenza rapida per stacco sulla fascia destra che la mette in mezzo dove fusco timbra: 1-0. raddoppio quasi immediato: pascale pesca iurlaro con uno scavetto sulla fascia, il numero 10 da posizione decentrata indovina un tiro al volo che non lascia scampo ad agrizzi: 2-0. gli ospiti non perdono la bussola e accorciano subito con il rasoterra di zanutini che riceve da corner e fa 1-2. finale di tempo da urlo con pozzatello che lancia bene leonardo de giorgio sulla fascia, palla in mezzo per iurlaro che in contrasto fa 3-1. secondo tempo ‚Äì il manzano non cala la concentrazione: occasione per iurlaro che aspetta troppo prima di calciare. la squadra tira alta l‚Äôintensit√† e l‚Äôaquila non riesce a riaprire la contesa. all‚Äô8‚Äô stacco percuote in mezzo e calcia, la palla deviata supera agrizzi e vale il 4-1. i locali giocano compatti e difendono col coltello tra i denti. pozzatello sempre attento: grandi interventi su dorbol√≤ e joao pedro. gli ospiti divorano una rete con bassetti che ben pescato da joao pedro spara alto solo in area. per il manzano pericolosi polidori e iurlaro in ripartenza, il secondo sfiora il 5¬∞ gol con l‚Äôesterno mentre la porta √® semiaperta. grande chance anche per polidori, bloccato da agrizzi a tu per tu. il centrale poi √® bravo a rientrare in difesa nella successiva ripartenza, stoppando un tiro avversario sulla linea di porta. un esempio di una prova di cuore che √® valsa il primo posto e la vittoria contro una delle squadre pi√π attrezzate del campionato. per il manzano ora si prospetta un weekend di riposo, prima dei quarti di finale, in casa, di sabato 1 novembre. l‚Äôavversaria sar√† la quarta classificata del gruppo a: una squadra tra aquileia, pasiano e clark. lo sapremo al termine dell‚Äôultimo turno di sabato prossimo. stessa attesa per definire la seconda classificata del gruppo b. piazzamento in gioco tra martignacco e udinese.",
