    "fullText": "manzano (ud) 18 ottobre 2025 terza vittoria di fila per l‚Äôu21 che ritaglia un posto nel gruppo di testa 8-2 mai in discussione contro il valpolicella. tripletta di zenjli, doppietta di polimeni. sabato prossimo a manzano match d‚Äôalta quota contro il pupi manzano: cabrera, persolja, avitabile, romanut, bon, polimeni, dalmasson, zraidi, zenjli, khayari, urizzi. all: piani team valpolicella: gaspari, perlini, rudari, rossati, boscaini, de masi davide, orlandi, mereuta, orsini, sartori, de masi alessandro, ronconi. all: andreis gol: primo tempo: zenjli, zenjli, polimeni. secondo tempo: ronconi, polimeni, bon, zenjli, avitabile, romanut, de masi davide. dominio del manzano u21 che supera 8-2 il team valpolicella e confeziona la terza vittoria consecutiva. i seggiolai hanno un livello superiore e forti della loro qualit√† individuale si divertono in campo. primo tempo dove il valpolicella regge per circa 20‚Äô (nel campionato u21 del veneto si giocano due tempi da 30‚Äô l‚Äôuno non effettivi) poi cade sotto i colpi di zenjli (doppietta) e polimeni. nella ripresa i seggiolai si scatenano con un 8-2 complessivo. ora i manzanesi sono nel gruppo di testa con 9 punti. sabato prossimo altra partita in casa contro l‚Äôadelino arieti pupi che insegue a quota 7. fischio d‚Äôinizio alle 19.00. primo tempo ‚Äì manzano che ha il pallino del gioco da subito. la porta di gaspari viene bersagliata. grosse occasioni soprattutto per bon e avitabile. l‚Äôingresso di zenjli complica ulteriormente i piani del valpolicella che fatica a contenere la qualit√† del numero 10. proprio zenjli sblocca la contesa verso la fine del primo tempo: palla intercettata e 1-0 col pallonetto. poco dopo avitabile vince un contrasto e manda in porta zenjli che fa 2-0. il tris nasce da corner: romanut batte in mezzo per polimeni che segna col tocco sotto. secondo tempo ‚Äì il controllo delle occasioni pende a favore del manzano ma la prima chance √® ospite, bravo il portiere cabrera a coprire il suo palo con un riflesso alto. i padroni di casa hanno il controllo ma una palla persa a centrocampo apre la strada a ronconi che in solitaria segna l‚Äô1-3. la squadra di piani si scuote immediatamente: gran scambio di khayari per polimeni che divora. il classe 2008 si rif√† subito: zraidi dal centro allarga per il compagno che dalla fascia la appoggia morbida sul secondo palo a mezza altezza: 4-1. da l√¨ √® un assolo manzanese. zenjli si divora un gol, poi di tacco su punizione propizia il 5-1 di bon in ribattuta. dalla bandierina romanut coglie il secondo assist di giornata smarcando zenjli per la sua tripletta. ancora romanut che percuote centralmente, al momento giusto allarga per zenjli che pesca avitabile sul secondo palo: 7-1. ottavo centro con avitabile che recupera palla e parte in solitaria, palla in area per romanut che segna con un tocco morbido. finale con acuto del valpolicella che accorcia grazie alla ribattuta di davide de masi.",
